import './App.css';
import Navbar from './components/Navbar'

const Home = () => {
  return(
    <>
    <h1>Hello World from React 201</h1>
    </>
  )
}


function App() {
  return (
    <div className="App">
      <Navbar />
      <Home />
    </div>
  );
}

export default App;
